import React from 'react'
import { useLocalStorageService } from '../hooks'

export default function LIst() {
    const localstorege = new useLocalStorageService()
    const item = localstorege.getItem('userOrder')
  return (

    <div key={item?.food_id} className='group relative'>
    <div className='aspect-h-1 aspect-w-1 w-full overflow-hidden rounded-md bg-gray-200 lg:aspect-none group-hover:opacity-75 lg:h-80'>
      <img
        src={item?.food_img}
        alt={item?.food_img}
        className='h-full w-full object-cover object-center lg:h-full lg:w-full'
      />
    </div>
    <div className='mt-4 flex justify-between'>
      <div>
        <h3 className='text-lg text-gray-700'>{item?.food_name}</h3>
      </div><p>{item?.quantity}</p>
      <p className='text-lg font-medium text-gray-900'>{item?.price}</p>
    </div>
  </div>


  )
}
